import React,{useEffect,useState} from 'react'
import { useDispatch,useSelector } from 'react-redux'
import { addChatData } from '../../Reducer/reducer'
import { Box } from '@mui/material'
let AllChatData = [
    {msg:'hello', id:1},
    {msg:'hello', id:2},
    {msg:'hello', id:3},
    {msg:'hello', id:4},
    {msg:'hello', id:5},
    {msg:'hello', id:6},
    {msg:'hello', id:7},
]
const ChatList = () => {
    const dispatch = useDispatch()
    const ChatData  = useSelector(state=>state?.reducer?.ChatData?.chat)
    useEffect(()=>{
        dispatch(addChatData(AllChatData))
    },[])
    console.log('chatData',ChatData)
    return(
        <>
          <Accordion
          sx={{
            width: "18vw",
            "&.Mui-expanded .MuiAccordionSummary-root": {
              minHeight: theme.spacing(2), // Decrease the size of the summary when expanded
            },
          }}
        >
          <AccordionSummary
            expandIcon={<ExpandMoreIcon sx={{ color: "#fff" }} />}
            aria-controls="panel1a-content"
            id="panel1a-header"
            sx={{
              backgroundColor: "#00559A",
              minHeight: "10px",
              height: "35px",
              color: "#fff",
              borderTopLeftRadius: "5px",
              borderTopRightRadius: "5px",
              mb: 0.5,
            }}
          >
            <Typography sx={{ color: "#fff" }}>Chat Box</Typography>
          </AccordionSummary>
          <AccordionDetails sx={{ backgroundColor: "whitesmoke", mt: -0.5 }}>
            <Box sx={{ height: "40vh", overflowY: "scroll" }}>
              {AccountList.map((ele, index) => (
                <Box key={ele.id}>
                  <Box
                    onClick={() => handleClickAccount(ele.id)}
                    sx={{
                      display: "flex",
                      justifyContent: "space-between",
                      cursor: "pointer",
                    }}
                  >
                    <SingleList
                      id={ele.id}
                      name={ele.username}
                      image={ele.profilepicture}
                    />
                    <FiberManualRecordIcon
                      sx={{ color: "blue", fontSize: "10px", mr: 2, mt: 2.5 }}
                    />
                  </Box>
                  <Divider sx={{ mt: 1.5 }} light />
                </Box>
              ))}
            </Box>
          </AccordionDetails>
        </Accordion>
        </>
    )
}
export default ChatList;
